import { FunctionComponent, ReactElement } from 'react';
import { Data, FoodData, Discounts, Items, initialState } from '../Reducers/cartReducer';

export default function Food(props: object) {
  const SORTED_FOODS = props.list;

  return(
    <>
    <div>
      {Object.keys(SORTED_FOODS).map((key: string) :ReactElement => {
        const foods = Object.values(key);
        return (
          <div key={key}>
            {foods}
          </div>
        ) 
      })}
    </div>
    </>
  )
}
